import React from 'react';
import Link from 'next/link';
import Router from 'next/dist/next-server/lib/router/router';

const indexPage = () => (
  <div>
    <h1>The Main Page</h1>
    <button onClick={() => Router.push('/auth')}>Go to Auth</button>
  </div>
);

export default indexPage;

